import axios from 'axios'
import { HOST_URL, publicApi } from '../api'

class ProductService {
  static async getPopularBooks() {
    const res = await axios.get("localhost:83/api/popular") //publicApi.get('/popular')
    return res.data
  }

  static async getDiscountedBooks() {
    const res = await publicApi.get("localhost:83/api/discount")
    return res.data
  }

}

export default ProductService
